/**
 * Remove cercas Markdown (```json```), acertos de aspas e tenta extrair
 * a parte que parece JSON (come√ßando em { ou [ at√© o √∫ltimo } ou ]).
 */
function cleanAndExtractJsonString(value) {
  if (value === null || value === undefined) return value;
  let s = String(value).trim();

  // Remove fence de Markdown de abertura com poss√≠vel linguagem (ex: ```json\n)
  s = s.replace(/^```[^\n]*\n?/, '').trim();
  // Remove fence de fechamento se existir
  s = s.replace(/\n?```$/, '').trim();

  // Se estiver completamente entre crases simples (inline code), remove
  if (s.startsWith('`') && s.endsWith('`') && s.length > 1) {
    s = s.slice(1, -1).trim();
  }

  // Encontra a primeira chave/colchete e o √∫ltimo fechamento correspondente
  const idxCurly = s.indexOf('{');
  const idxSquare = s.indexOf('[');
  let firstIdx = -1;
  if (idxCurly === -1) firstIdx = idxSquare;
  else if (idxSquare === -1) firstIdx = idxCurly;
  else firstIdx = Math.min(idxCurly, idxSquare);

  if (firstIdx === -1) {
    // nada que pare√ßa JSON; retorna a string limpa
    return s;
  }

  const opening = s[firstIdx];
  const closing = opening === '{' ? '}' : ']';
  const lastIdx = s.lastIndexOf(closing);
  if (lastIdx === -1 || lastIdx <= firstIdx) {
    // n√£o achou fechamento √≥bvio; retorna a string limpa
    return s;
  }

  // Retorna somente o fragmento que provavelmente √© JSON
  return s.slice(firstIdx, lastIdx + 1).trim();
}

/**
 * Tenta v√°rias estrat√©gias de parse:
 *  - se for objeto/array j√° (n√£o string), retorna direto
 *  - limpa cercas e extrai substring JSON
 *  - tenta JSON.parse; se resultar em string, tenta parse novamente (double-encoded)
 *  - se falhar, tenta achar primeiro trecho tipo {...} ou [...] com regex
 */
function tryParseJson(value) {
  if (value === null || value === undefined) throw new Error('Valor vazio');
  if (typeof value === 'object') return value; // j√° √© objeto/array

  let candidate = cleanAndExtractJsonString(value);
  if (!candidate) throw new Error('Conte√∫do vazio ap√≥s limpeza');

  // Se estiver entre aspas (ex: "\"{...}\""), remove as aspas externas e unescape simples
  if ((candidate.startsWith('"') && candidate.endsWith('"')) ||
      (candidate.startsWith("'") && candidate.endsWith("'"))) {
    candidate = candidate.slice(1, -1);
    candidate = candidate.replace(/\\"/g, '"').replace(/\\'/g, "'");
  }

  try {
    const parsed = JSON.parse(candidate);
    // Se parse resultou em string, pode ser JSON duplamente codificado: tenta de novo
    if (typeof parsed === 'string') {
      try {
        return JSON.parse(parsed);
      } catch (e) {
        return parsed;
      }
    }
    return parsed;
  } catch (err) {
    // tentativa final: extrair primeiro trecho que come√ßa com { ou [ e termina com } ou ]
    const m = candidate.match(/([{[][\s\S]*[}\]])/);
    if (m && m[1]) {
      try {
        return JSON.parse(m[1]);
      } catch (e2) {
        // nada mais a fazer ‚Äî lan√ßa o erro original para tratamento acima
      }
    }
    throw err;
  }
}

