  // Fun√ß√£o para converter data num√©rica do Excel para YYYYMMDD
  function excelDateToYYYYMMDD(excelDate) {
    const num = Number(excelDate);
    if (!isFinite(num) || num <= 0) return null; // valida n√∫mero

    // Data base do Excel: 1 de janeiro de 1900 (com ajuste do bug de 1900)
    const excelEpoch = new Date(1900, 0, 1);
    const adjustedExcelDate = num > 59 ? num - 2 : num - 1;
    const jsDate = new Date(excelEpoch.getTime() + (adjustedExcelDate * 24 * 60 * 60 * 1000));

    const year = jsDate.getFullYear();
    const month = String(jsDate.getMonth() + 1).padStart(2, '0');
    const day = String(jsDate.getDate()).padStart(2, '0');

    return `${year}${month}${day}`;
